class Picture {
    static takePicture(successCallback, errorCallback){
        navigator.camera.getPicture(
            function (imageData) {
                // imageData contient l'image capturée au format Base64, sans en-tête MIME
                // On appelle successCB en lui transmettant une entité Image
                successCallback.call(this, new Image(imageData));
            },
            function (err) {
                console.log("Erreur Capture image : " + err.message);
                errorCallback.call(this);
            },
            {quality: 50, destinationType: navigator.camera.DestinationType.DATA_URL}
            // qualité encodage 50%, format base64 (et JPEG par défaut)
        );
    }

    static createImageFromFile(userImage, callback) {
        var reader = new FileReader();

        reader.onloadend = function() {
            callback.call(this, new Image(reader.result));
        }

        reader.readAsDataURL(userImage);
    }
}

class Image {
    constructor(imageData) {
        this._imageData = imageData;
    }

    get base64(){
        if(this._imageData.includes(";base64,")){
            return this._imageData; //Si l'image est encodée depuis un fichier, le base64 est inclu lors de la conversion
        }
        return "data:image/jpeg;base64,"+this._imageData;
    }
}

